 // Define the output object here
var output = {};

// return output;
var decayS = function(x,a,b){
 return a * Math.exp( -x / b );
};



var elapsed_time = JSON.stringify(json.set[2].e_time);
output.elapsed_time = elapsed_time;

// output.test = JSON.stringify(json);
// return output;

//find pointers to the first points for each PIRK subtrace

var baseline_pulses = json.v_arrays[1][4];

var pirk_pulses = json.v_arrays[1].slice(4);

output.pirk_pulses=pirk_pulses;

var first_pirk_points = [];

first_pirk_points.push(pirk_pulses[0]);
//first_pirk_points.push(pirk_pulses[0] + );


var number_of_pirk_measureing_pusles = json.v_arrays[1][3];

first_pirk_points.push(first_pirk_points[first_pirk_points.length-1] + pirk_pulses[0] + number_of_pirk_measureing_pusles);

first_pirk_points.push(first_pirk_points[first_pirk_points.length-1] + pirk_pulses[0] + number_of_pirk_measureing_pusles);
first_pirk_points.push(first_pirk_points[first_pirk_points.length-1] + pirk_pulses[0] + number_of_pirk_measureing_pusles);

for (var i=1; i<pirk_pulses.length; i++) {
  first_pirk_points.push(first_pirk_points[first_pirk_points.length-1] + pirk_pulses[i]+ number_of_pirk_measureing_pusles);

}

  // first_pirk_points.push(first_pirk_points[first_pirk_points.length-1] + pirk_pulses[i-1]+ number_of_pirk_measureing_pusles);

output.first_pirk_points = JSON.stringify(first_pirk_points);


output.elapsed_time = [];

var PIRK = GetProtocolByLabel("PIRK",json,true);
output.number_of_traces = PIRK.length;

var environmental = GetProtocolByLabel("env",json,true);

// output.xxx = JSON.stringify(environmental);

output.elapsed_time.push(environmental[0].e_time[1]);


output.PAR =  environmental[0].light_intensity;

output.leaf_temperature =  environmental[0].contactless_temp;

output.ERRORS = "";
var all_traces = [];

for (var i=0; i<PIRK.length;i++){

  var PIRK_trace = PIRK[i].data_raw;


  var PIRK_ECS = ArrayNth(PIRK_trace,3,0);
  var PIRK_FLUOR = ArrayNth(PIRK_trace,3,1);
  var PIRK_P700 = ArrayNth(PIRK_trace,3,2);

  if (MathMEAN(PIRK_ECS) < 10000) {
    output.ERRORS += "ECS trace";
  }

  PIRK_ECS = TransformTrace("abs", PIRK_ECS, MathMEAN(PIRK_ECS.slice(10,20)));

  PIRK_ECS = TransformTrace("*", PIRK_ECS, 1000);

  PIRK_P700 = TransformTrace("abs", PIRK_P700, MathMEAN(PIRK_ECS.slice(10,20)));

  PIRK_P700 = TransformTrace("*", PIRK_P700, 1000);

  output["PIRK_ECS_trace_"+i]=PIRK_ECS;
  output["PIRK_CHL_F_"+i]=PIRK_FLUOR;
  output["PIRK_P700_trace_"+i]=PIRK_P700;

  all_traces.push(PIRK_ECS);
  output.elapsed_time.push(PIRK[i].e_time[0]);

  var first_points_array = [];

  for (var j=0; j < first_pirk_points.length; j++ ) {
     var ecs_pirk_diff = PIRK_ECS[first_pirk_points[j]+1] - MathMEAN(PIRK_ECS.slice(first_pirk_points[j]-4, first_pirk_points[j]-1));
      first_points_array.push(ecs_pirk_diff);
  }

  output["PIRK_ECS_"+i]=first_points_array;

  var f_pirk_0_array_F = [];
  var f_pirk_1_array_F = [];
  var wasp_F = [];

  for (var j=0; j < first_pirk_points.length; j++ ) {
     var f_pirk_0 = MathMEAN(PIRK_FLUOR.slice(first_pirk_points[j]-4, first_pirk_points[j]-1));
      var f_pirk_1 = PIRK_FLUOR[first_pirk_points[j] + 1]; //first_pirk_points[j]-4, first_pirk_points[j]-1));

    // PIRK_FLUOR[first_points_array_F[j]+1] - MathMEAN(PIRK_FLUOR.slice(first_points_array_F[j]-4, first_points_array_F[j]-1));
      f_pirk_0_array_F.push(f_pirk_0);
      f_pirk_1_array_F.push(f_pirk_1);
      wasp_F.push(1000*((1/f_pirk_0) - (1/f_pirk_1)));
  }

  output["PIRK_F_"+i] = [f_pirk_0_array_F, f_pirk_1_array_F];
  output["wasp_F"+i] = wasp_F;

// Error checking
output.all_traces=all_traces;

}

if (output.ERRORS === "") {
  output.ERRORS = "none";
}
var FsVals = [];
var FmVals = [];
var Phi2 = [];

var pamTraces = GetProtocolByLabel("PAM", json, true);

for (var i=0; i<pamTraces.length;i++) {
  output.elapsed_time.push(pamTraces[i].e_time[1]);
  var allpamTraces = pamTraces[i].data_raw;

  output["Fluorescence Trace " + i] = ArrayNth(allpamTraces,2,0);
  var PAM = ArrayNth(allpamTraces,2,0);
  var FsTrace= PAM.slice(0,39);
  Fstrace=FsTrace.sort;
  FsVal = MathMEAN(FsTrace.slice(FsTrace.length-4, FsTrace.length-1));
  FsVals.push(FsVal);

  output["P700 Trace " + i] = TransformTrace("abs", ArrayNth(allpamTraces,2,1));

  var FmTrace= PAM.slice(40,90);
  Fmtrace=FmTrace.sort;
  var FmVal = MathMEAN(FmTrace.slice(0, 4));
  FmVals.push(FmVal);

  Phi2.push(MathROUND(1-(FsVal/FmVal), 3));
  output["Phi2_" + i] = MathROUND(1-(FsVal/FmVal), 3);
}

var finish = GetProtocolByLabel("finish", json, true);

output.elapsed_time.push(finish[0].e_time[1]);

// output.FsVals=FsVals; 
// output.FmVals=FmVals;
output.Phi2_0=Phi2[0];

output.elapsed_time = TransformTrace("subtract", output.elapsed_time, output.elapsed_time[0]).join();

var spad_data = GetProtocolByLabel("spad", json, true);
output.spad = JSON.stringify(spad_data[0].spad[0]);

return output;
